  function UploadContent(address sender, string memory _ccid, string memory _version, string memory _contentType, string memory _fileLink,
    uint _ccidState,uint _ccidPrice, uint time, string memory _refCc, uint versionState, uint versionPrice)
    public returns (bool)
    {
      require(contentStorage.checkContentExists(_ccid) == false);  // check for content existance
      require(contentStorage.checkVersionExists(_version) == false); // check for version existance
       // save content in contentStorage contract
      contentStorage.ContentRegist(sender, _ccid, _version, _contentType, _fileLink, _ccidState, _ccidPrice, time,
