      require(contentStorage.onlySeller(_ccid, sender));
      require(contentStorage.checkVersionExists(_version) == false);  // check for version existance

      contentStorage.contentUpdate(sender, _ccid, _version, _referenceId, state, price, time);

      emit ContentUpdated(sender, _ccid, _version, price, time);


      return true;

    }
    /***************************
